import styled from 'styled-components';

export const Container = styled.div`
  margin-top: auto;

  min-height: 50px;
  z-index: 999;
  display: flex;
  align-items: center;
  background: #434c5b;

  ul {
    display: flex;
    flex-direction: row;

    align-items: center;
    padding: 5px;

    background: #434c5b;

    list-style: none;
  }
`;
